Memo_DP:
Considérant que le permis unique délivré en date du 25/07/2003, par le Collège des Bourgmestre et Echevins de THUIN pour la construction et l'exploitation d'un commerce de véhicules automobiles neufs et d'occasion, comprenant plus de trois ponts, une zone de lavage des véhicules, un réservoir d'air comprimé et un dépôt d'huiles, à l'adresse ici concernée;

Considérant, au vu du plan d'implantation founi, que le projet consiste en l'extension du bâtiment existant vers l'arrière de la parcelle avec, comme conséquence, un débordement très important en zone agricole; que votre demande porte également sur le recouvrement du solde de la parcelle située en zone agricole par un revêtement en tarmac;

Considérant, à cet égard, que votre projet n'est pas conforme à l'article 35 du Code Wallon de l'Aménagement du Territoire, de l'Urbanisme et du Patrimoine prescrivant que :

"La zone agricole est destinée à l'agriculture au sens général du terme.  Elle contribue au maintien ou à la formation du paysage.

Elle ne peut comporter que les constructions indispensables à l'exploitation et le logement des exploitants dont l'agriculture constitue la profession."

Considérant, toutefois, le dispositif de l'article 111 du Code Wallon de l'Aménagement du Territoire, de l'Urbanisme et du Patrimoine, prescrivant que : "Les constructions, les installations ou les bâtiments existant avant l'entrée en vigueur du plan de secteur ou qui ont été autorisés, dont l'affectation actuelle ou future ne correspond pas aux prescriptions du plan de secteur peuvent faire l'objet de travaux de transformation, d'agrandissement ou de reconstruction.

Pour des besoins économiques, (les bâtiments et installations ou ensembles de bâtiments et installations qui forment une unité fonctionnelle, conformes au plan de secteur ou existant avant l'entrée en vigueur du plan de secteur, dont l'agrandissement est projeté dans le périmètre visé à l'article 1er, 5°, du décret du 11 mars 2004 relatif aus infrastructures d'accueil des activités économiques - Déccret du 1er juin 2006, art.2; al.2) peuvent faire l'objet de travaux de transformation ou d'agrandissement impliquant une dérogation à l'affectation d'une zone contiguë (,,,)";

Considérant, à cet égard qu'aucun périmètre de reconnaissance au sens de l'article 1er, 5°, du décret du 11 mars 2004 relatif aux infrastructures d'accueil des activités économiques (Décret du 1er juin 2006, art.2, al.2) n'a été arrêté, et que, par voie de conséquence, je ne puis qu'émettre un avis défavorable.

memo_Autorisation:
Conditions
- obligation de se raccorder immédiatement à l’égout existant, si tel n’est pas le cas ;
