•	Le demandeur devant être pleinement conscient de l’état de la voirie jusque minimum 2012 et dès lors ne pas se prévaloir auprès de la Ville d’une quelconque intervention sur celle-ci ;
•	Le demandeur devra fournir le formulaire de classe 3 pour la micro-station d’épuration.

-	respect des conditions du service incendie (en annexe) ;
-	le volume à construire sera implanté avec un recul d’1m50 sur l’alignement existant de manière à favoriser la visibilité du carrefour ;
-	le trottoir Rue de Marchienne sera prolongé jusqu’à cette nouvelle façade à l’aide de matériaux identique à ceux placés au niveau des trottoirs ;
-	une grille sera intégrée dans la façade rue Vandervelde de manière à animer celle-ci et permettre un accès plus rapide vers le volume à construire ;
-	le WC 2a du 1° étage de l’appartement A devra se situer à gauche du porteur et non « encastré » dans le plan de l’appartement B, et ce dans un soucis de résistance au feu, d’acoustique et pour respecter une certaine logique constructive en cas de division ultérieure du bien ;
-	les divisions de châssis telles que proposées seront respectées ;
-	les pilastres en pierre bleue de la grille actuelle seront récupérées et intégrées dans le projet ;
