-	respect des remarques du Commissaire Voyer reçues le 26 mars 2008 pour les parkings (en annexe);
-	les eaux usées seront raccordées à l’égout sans épuration préalable ;
-	les eaux de pluies seront récoltées dans une ou plusieurs citernes à eaux de pluie et utilisées à l’intérieur du bâtiment. Compte tenu du fait qu’il s’agit d’une rénovation et de la densité de construction sur le bien : le trop plein des citerne peut être raccordé à l’égout. Seules les versants à rue des immeubles ABH-I-SCF pourront avoir leurs DEP raccordées à l’égout.

-	placement de faux cintrage au droit des baies présentant un linteau courbe ;
-	prévoir un autre modèle de porte d’entrée similaire au modèle existant ;
-	prévoir la remise en peinture de ton brun de l’habillage bois des lucarnes ;
-	prévoir les châssis des lucarnes en brun ;
-	prévoir la remise en peinture des menuiseries au niveau de la cave en blanc.

Conditions :
- l’enseigne située sur la façade latérale sera à dominante verticale (voir plan de principe en annexe) ;
- les enseignes situées en façade avant reproduiront le schéma établi par Brantano, soit un module carré au-dessus de l’entrée avec le logo (de même dimension que le module Brantano) et un module rectangulaire à gauche de l’entrée (de même hauteur que celui du Brantano mais pouvant être posé directement sur le mur en briques) ;
- les enseignes posées en infraction seront démontées et remplacées par des enseignes conformes au permis au plus tard pour le jour de l’inauguration, faute de quoi, l’infraction sera verbalisée par la Police.

