-	les petits bois seront apposés sur les vitrages et non encastrés dans le double vitrage, ils seront de la même nature que le châssis (pas de croisillons dorés et pas de petits bois dans les vitrages qui en sont dépourvus)
-	le PVC sera blanc ou gris mais pas dans une imitation bois.

Article 1er : Le permis d'urbanisme sollicité par Monsieur et Madame BOUILLARD-LAMBOTTE est REFUSE pour la construction du garage.  Un permis d’urbanisme en régularisation devra être introduit après la perception de l’amende si telle est le mode de réparation décidé.

Article 2 : Le permis d'urbanisme sollicité par Monsieur et Madame BOUILLARD-LAMBOTTE est REFUSE pour la régularisation de l’arrachage de 44 mètres de haie.

Article 3 : Le permis d'urbanisme sollicité par Monsieur et Madame BOUILLARD-LAMBOTTE est OCTROYE pour la régularisation des extensions de l’habitation et la démolition du mur de clôture établi à l’alignement.

Article 4 : Le permis d'urbanisme sollicité par Monsieur et Madame BOUILLARD-LAMBOTTE est OCTROYE pour la modification d’aspect architectural d’un bâtiment aux conditions suivantes :

•	les nouveaux parements seront réalisés en briques de ton rouge similaire à l’existant dans le respect des appareillages existants ;
•	la brique sera soumise pour approbation au Collège ;
•	le parement du bâtiment existant sera « rénové » à l’identique (nettoyage de surface ou sablage, rejointoyage de ton gris et éventuellement pose d’un hydrofuge mat) ;
•	aucune eau (épurée ou de pluie) ne pourra se déverser dans le chemin ;

Article 5 : Le permis d'urbanisme sollicité par Monsieur et Madame BOUILLARD-LAMBOTTE est OCTROYE pour la régularisation de la modification du relief du sol sur base du plan adapté approuvé en annexe qui reprend les conditions suivantes :

•	la modification du relief sera régularisée sur une profondeur de 18 mètres depuis la façade arrière du bâtiment principal à condition de prévoir un mur de soutènement de type gabions ou mur en briques rouges et des talus de rattrapage du relief naturel de part et d’autre ;
•	au-delà de ce mur de soutènement, le profil de terrain sera adouci suivant un profil estimé être le terrain naturel, les courbes de niveau du côté du terrain riverain seront également adoucies ;
•	les terres excédentaires seront évacuées dans un délai de 2 mois à dater de la réception du permis, si les terres devaient être maintenues passé ce délai l’infraction serait verbalisée.

-	Placement d’une vitrine dans la façade à rue ;
-	Placement d’autres éléments de caillebotis métalliques et plantation de végétations grimpantes aux pieds de ceux-ci en vue de végétaliser un peu la façade ;
-	Respect des conditions du service Incendie (en annexe).

Des plans corrigés en ce sens ont été transmis au service Urbanisme. 
Les travaux seront exécutés suivants les plans approuvés en veillant à la plantation de végétations grimpantes sur les caillebotis métalliques.

	respect des plans modifiés datés du 30/06/08 ;
	la dalle béton aura une épaisseur minimale de 20 cm sur la partie du chemin agricole et sur toute la largeur ; elle comportera un joint scié longitudinal reprenant la largeur du chemin tous les 5 mètres ;
	La réalisation complète des plantations au plus tard pour la fin de l’année qui suit la construction du bâtiment ;
	Les murs périphériques du bâtiment à construire seront réalisés en briques de terre cuite similaires à l’ancien bâtiment voisin (situé à côté de la glacière) ;
	Le demandeur dispose d’un délai de 6 mois pour poser les briques de parement sur le bâtiment voisin jouxtant la demande et ce conformément aux conditions du permis délivré le 27/01/1997, passé ce délai, l’infraction sera verbalisée.

-	les habitations seront alignées sur le voisin de droite, soit avancées de 4m50 (sur l’alignement).  Une implantation corrigée a été transmise au service urbanisme pour la délivrance des documents officiels ;
-	les demandeurs prendront les dispositions qui s’imposeraient en amont pour éviter tout dommage important lors des fortes pluies ;
-	une fosse de décantation toutes eaux suffisamment dimensionnée sera placée avant rejet à l’égout.

-	la brique sera d’une tonalité rouge-brun conformément aux prescriptions du lotissement : la brique Wanlin brune étant autorisée ; les briques Lavagrijs de chez Heylen et Rocher Brun foncé de chez Terca refusées ;
-	la fosse septique toutes eaux prévue aux plans sera maintenue ;
-	le trop plein de la citerne ne sera pas raccordé au réseau mais à un puit perdu ou drain dispersant ;
-	toute plantation ultérieure sera d’essences régionales et conforme à la circulaire ministérielle du 24.04.1985 ;
-	et sur base de l’implantation modifiée.

-	La rampe d’accès sera munie d’un revêtement perméable et de teinte grise ;
