1.	terrassement et fondations ;
2.	sous-fondation et fondation ;
3.	revêtements ;
4.	éléments linéaires ;
5.	drainage et égouttage ;
6.	signalisation routière.

-	Prévoir un parement en brique peintes en blanc à blanc cassé ou enduit de même teinte ou briques de ton rouge foncé (à l’exception d’un traitement de joint ton sur ton avec la brique Espagnole dont la tonalité rouge est trop vive)
-	Fournir la référence exacte de la brique pour approbation au Collège ;
-	Une fosse de décantation toutes eaux sera installée avant rejet à l’égout afin de liquéfier les effluents ;
-	Le trop plein de la citerne ne sera pas déversé dans l’égout mais percolera naturellement dans le sol via drains dispersants ou puits perdant.

