memo_Autorisation:
•	l'annexe arrière abritant le hall et le WC sera supprimée. La passerelle sera localisée à l'emplacement de la dite annexe. Le hall et le WC seront intégrés au corps de bâtisse ;
•	la consolidation de l'élévation à rue sera privilégiée à sa complète reconstruction. Le dessin de la façade sera conservé en l'état (encadrement de pierre, baies ...) ;
•	un enduit de teinte claire sera mis en oeuvre sur les façades ;
•	les nouveaux châssis seront adaptés à la typologie des baies existantes. Un modèle unique de châssis (teinte et division en T ou en double ouvrant) sera prévu sur l'élévation à rue : l'aspect mouluré des menuiseries sera garanti grâce à la pose d'un profilé rejet d'eau, le PVC coloré (donc pas blanc) sera structuré c'est-à-dire qu'il présentera une imitation de veine de bois en relief/creux, la partie supérieure suivra le cintre du linteau ;
•	la toiture en tôle ondulée du garage sera supprimée. Les murs en bloc de bétons apparents seront cimentés et peints en blanc. Le portique en bois prévu sera remplacé par un portail métallique laqué ;
